    <div class="mBodyText" style="color:#333; font-size:14px; margin-bottom: 10px;font-family:'Open Sans', sans-serif, Arial, sans-serif;  width:100%;">

      <div style="max-width:100%; clear:both;">
        <div><span style="font-size:12px;">Hello&nbsp;William&nbsp;Chirico</span></div>

<div>&nbsp;</div>

<div><span style="font-size:12px;">My name is Anshu Chaudhary and I am a Staffing Specialist at JS Consulting.&nbsp;I am reaching out to you on an exciting job opportunity with one of our clients.</span></div>

<div>&nbsp;</div>

<div>
<p><span style="font-size:12pt"><span style="font-family:Calibri,sans-serif"><b><u><span style="font-size:11.0pt">Job Title</span></u></b><b><span style="font-size:11.0pt">-&nbsp;&nbsp; &nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;</span></b><b><span lang="EN-US" style="font-size:11.0pt">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; Senior .Net Web Engineer with ML</span></b></span></span></p>

<p><span style="font-size:12pt"><span style="font-family:Calibri,sans-serif"><b><u><span style="font-size:11.0pt">Project Location</span></u></b><b><span style="font-size:11.0pt">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; &nbsp;&nbsp;&nbsp;Remote</span></b></span></span></p>

<p><span style="font-size:12pt"><span style="font-family:Calibri,sans-serif"><b><u><span style="font-size:11.0pt">Project Duration</span></u></b><b><span style="font-size:11.0pt">-&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;full time</span></b></span></span></p>

<p><span style="font-size:12pt"><span style="font-family:Calibri,sans-serif"><b><span lang="EN-US" style="font-size:11.0pt">Visa-:&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; &nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;<a name="_Hlk161992263">US Citizen </a>Only</span></b></span></span></p>

<p><span style="font-size:12pt"><span style="font-family:Calibri,sans-serif">&nbsp;</span></span></p>

<p><span style="font-size:12pt"><span style="font-family:Calibri,sans-serif"><b><span style="font-size:11.0pt">Must have valid LinkedIn profile with profile pic and good number of connection and must be created before 2020.</span></b></span></span></p>

<p><span style="font-size:12pt"><span style="font-family:Calibri,sans-serif">&nbsp;</span></span></p>

<p><span style="font-size:12pt"><span style="font-family:Calibri,sans-serif"><b><span lang="EN-US" style="font-size:11.0pt">Job Description-:</span></b></span></span></p>

<p><span style="font-size:12pt"><span style="font-family:Calibri,sans-serif"><span lang="EN-US" style="font-size:11.0pt">Senior Web & Azure Machine Learning Engineer (Remote)</span></span></span></p>

<p><span style="font-size:12pt"><span style="font-family:Calibri,sans-serif"><span lang="EN-US" style="font-size:11.0pt">&nbsp;We&rsquo;re seeking a Senior Web & Azure ML Engineer who can own full-stack delivery and the ML lifecycle in Azure&mdash;from data to deployment&mdash;to power our Digital Tele-Optometry platform and AI features.</span></span></span></p>

<p><span style="font-size:12pt"><span style="font-family:Calibri,sans-serif"><b><span lang="EN-US" style="font-size:11.0pt">What You&rsquo;ll Do</span></b></span></span></p>

<ul>
	<li><span style="font-size:12pt"><span style="tab-stops:list 18.0pt"><span style="font-family:Calibri,sans-serif"><span lang="EN-US" style="font-size:11.0pt">End-to-end ML in Azure: Train, evaluate, and deploy models using Azure Machine Learning Studio & the Azure ML SDK (Python). Package models as real-time/batch endpoints and integrate them into ASP.NET/Core services.</span></span></span></span></li>
	<li><span style="font-size:12pt"><span style="tab-stops:list 18.0pt"><span style="font-family:Calibri,sans-serif"><span lang="EN-US" style="font-size:11.0pt">MLOps at scale: Build CI/CD for ML with Azure DevOps (pipelines, artifacts, environments).</span></span></span></span></li>
	<li><span style="font-size:12pt"><span style="tab-stops:list 18.0pt"><span style="font-family:Calibri,sans-serif"><span lang="EN-US" style="font-size:11.0pt">Responsible AI & monitoring: Performance telemetry via AML monitoring/Azure Monitor.</span></span></span></span></li>
	<li><span style="font-size:12pt"><span style="tab-stops:list 18.0pt"><span style="font-family:Calibri,sans-serif"><span lang="EN-US" style="font-size:11.0pt">Production integration: Expose model inference securely to .NET/API backends (App Service/AKS); optimize latency, throughput, and cost.</span></span></span></span></li>
	<li><span style="font-size:12pt"><span style="tab-stops:list 18.0pt"><span style="font-family:Calibri,sans-serif"><span lang="EN-US" style="font-size:11.0pt">Web application delivery: Design, build, and scale cloud-native web apps (C#/ASP.NET, SQL, JavaScript) in Microsoft Azure&mdash;including real-time experiences (SignalR).</span></span></span></span></li>
	<li><span style="font-size:12pt"><span style="tab-stops:list 18.0pt"><span style="font-family:Calibri,sans-serif"><span lang="EN-US" style="font-size:11.0pt">Operational excellence: Establish incident playbooks, logging/alerting (App Insights).</span></span></span></span></li>
	<li><span style="font-size:12pt"><span style="tab-stops:list 18.0pt"><span style="font-family:Calibri,sans-serif"><span lang="EN-US" style="font-size:11.0pt">Collaboration: Work closely with web devs, designers, and cross-functional teams to deliver new functionality for a growing, AI-enabled platform.</span></span></span></span></li>
</ul>

<p><span style="font-size:12pt"><span style="font-family:Calibri,sans-serif"><b><span lang="EN-US" style="font-size:11.0pt">Required Qualifications</span></b></span></span></p>

<ul>
	<li><span style="font-size:12pt"><span style="tab-stops:list 18.0pt"><span style="font-family:Calibri,sans-serif"><span lang="EN-US" style="font-size:11.0pt">7+ years building web applications (C#/ASP.NET, Web API, JavaScript/TypeScript).</span></span></span></span></li>
	<li><span style="font-size:12pt"><span style="tab-stops:list 18.0pt"><span style="font-family:Calibri,sans-serif"><span lang="EN-US" style="font-size:11.0pt">5+ years on Microsoft Azure with production workloads (App Service, SQL, Storage, networking).</span></span></span></span></li>
	<li><span style="font-size:12pt"><span style="tab-stops:list 18.0pt"><span style="font-family:Calibri,sans-serif"><span lang="EN-US" style="font-size:11.0pt">Azure ML hands-on experience: training and deploying models with Azure ML Studio/SDK, model registry, endpoints, and monitoring.</span></span></span></span></li>
	<li><span style="font-size:12pt"><span style="tab-stops:list 18.0pt"><span style="font-family:Calibri,sans-serif"><span lang="EN-US" style="font-size:11.0pt">MLOps with Azure DevOps: pipelines for data + model CI/CD, gated releases, infrastructure-as-code (Bicep/Terraform or ARM), and secrets management.</span></span></span></span></li>
	<li><span style="font-size:12pt"><span style="tab-stops:list 18.0pt"><span style="font-family:Calibri,sans-serif"><span lang="EN-US" style="font-size:11.0pt">Data/Model fundamentals: feature engineering, evaluation, cross-validation, experiment tracking.</span></span></span></span></li>
	<li><span style="font-size:12pt"><span style="tab-stops:list 18.0pt"><span style="font-family:Calibri,sans-serif"><span lang="EN-US" style="font-size:11.0pt">SQL proficiency and production API integration of ML services into .NET apps running in Azure.</span></span></span></span></li>
	<li><span style="font-size:12pt"><span style="tab-stops:list 18.0pt"><span style="font-family:Calibri,sans-serif"><span lang="EN-US" style="font-size:11.0pt">Strong debugging/issue resolution skills across web apps and services.</span></span></span></span></li>
</ul>

<p><span style="font-size:12pt"><span style="font-family:Calibri,sans-serif"><b><span lang="EN-US" style="font-size:11.0pt">Nice to Have</span></b></span></span></p>

<ul>
	<li><span style="font-size:12pt"><span style="tab-stops:list 18.0pt"><span style="font-family:Calibri,sans-serif"><span lang="EN-US" style="font-size:11.0pt">Government PIV familiarity and prior US government environment exposure.</span></span></span></span></li>
	<li><span style="font-size:12pt"><span style="tab-stops:list 18.0pt"><span style="font-family:Calibri,sans-serif"><span lang="EN-US" style="font-size:11.0pt">Experience with SignalR, pub-sub architectures, embedded video conferencing, and real-time UX.</span></span></span></span></li>
	<li><span style="font-size:12pt"><span style="tab-stops:list 18.0pt"><span style="font-family:Calibri,sans-serif"><span lang="EN-US" style="font-size:11.0pt">Experience building Whisper or speech-enabled applications/pipelines.</span></span></span></span></li>
	<li><span style="font-size:12pt"><span style="tab-stops:list 18.0pt"><span style="font-family:Calibri,sans-serif"><span lang="EN-US" style="font-size:11.0pt">Telerik / Kendo / DevExpress component libraries.</span></span></span></span></li>
	<li><span style="font-size:12pt"><span style="tab-stops:list 18.0pt"><span style="font-family:Calibri,sans-serif"><span lang="EN-US" style="font-size:11.0pt">Exposure to Azure Kubernetes Service (AKS), Docker.</span></span></span></span></li>
</ul>

<p><span style="font-size:12pt"><span style="font-family:Calibri,sans-serif"><b><span lang="EN-US" style="font-size:11.0pt">Tools & Stack You&rsquo;ll Use</span></b></span></span></p>

<ul>
	<li><span style="font-size:12pt"><span style="tab-stops:list 18.0pt"><span style="font-family:Calibri,sans-serif"><span lang="EN-US" style="font-size:11.0pt">Azure: AML (workspaces, compute, registry, endpoints), App Service/AKS, /App Insights.</span></span></span></span></li>
	<li><span style="font-size:12pt"><span style="tab-stops:list 18.0pt"><span style="font-family:Calibri,sans-serif"><span lang="EN-US" style="font-size:11.0pt">Dev & MLOps: Azure DevOps (Repos/Pipelines/Boards), Git, CI/CD for app & model, Infrastructure as Code.</span></span></span></span></li>
	<li><span style="font-size:12pt"><span style="tab-stops:list 18.0pt"><span style="font-family:Calibri,sans-serif"><span lang="EN-US" style="font-size:11.0pt">Frontend: JavaScript/TypeScript (frameworks as applicable).</span></span></span></span></li>
</ul>

<p><span style="font-size:12pt"><span style="font-family:Calibri,sans-serif"><span lang="EN-US" style="font-size:11.0pt">Who You&rsquo;ll Work With</span></span></span></p>

<p><span style="font-size:12pt"><span style="font-family:Calibri,sans-serif"><span lang="EN-US" style="font-size:11.0pt">You&rsquo;ll join a growing web engineering team and collaborate with product, data/ML, and clinical stakeholders to deliver AI-powered optometry workflows at scale.</span></span></span></p>
</div>

<div id="EditorSignatureID">
